import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, ImageBackground } from 'react-native';
import EyeItem from './components/EyeItem';

export default function App() {
  return (
    <View style={styles.container}>

      <View style={styles.eyeContainer}>

        <ImageBackground 
        source={require('D:\\Facultate Anul III\\SeverinReactApp\\reactappn\\assets\\images\\BackPhoto.jpeg')}
        style={styles.image}
        />



        <View style={styles.titles}>
          <Text style={styles.title}>We Become Your Eyes</Text>
          <Text style={styles.subtitles}>Here To Help You</Text>
        </View>

      </View>

      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  eyeContainer:{
    width:'100%',
    height:'100%',

  },

  titles: {
    marginTop: '30%',
    width:'100%',
    alignItems: 'center',
  },

  title: {
    fontSize: 40,
    fontWeight:'500',
  },

  subtitles: {
    fontSize:16,
    color: 'grey',

  },

  image: {
    width:'100%',
    height:'100%',
    resizeMode: 'cover',
    position: 'absolute',
  },
});
